import React from 'react'
import { Button, Typography, Box } from '@mui/material'

const LinkButton = ({ to, text, textProps, buttonProps }) => {
  return (
    <Box mx={1}>
      <Button 
        variant="outlined" 
        onClick={() => {window.location.href = {to} || '/home'}}
        {...buttonProps}
      >
        <Typography {...textProps}>
          {text}
        </Typography>
      </Button>
    </Box>
  )
}

export default LinkButton
